101,5,1,#:Event_If_Level 1 1 0:#:Event_Transport 0 0 0 53:,回到日輪海岸,
151,5,1,#:Event_If_ScreenMessage 4 31125 17:#:Event_ScreenMessage 31125 0 0:Event_MonsterAction 1 1020 3660 2 57 0:Event_EventState 151 6 0:,前方有隻月光兔正在向你招手，向前和她了解一下狀況吧。,
152,5,1,#:Event_If_RebornMonster 2 5 0:Event_If_ScreenMessage 4 31124 17:#:Event_ScreenMessage 31124 0 0:Event_EventState 152 6 0:,這邊的道路已經被腐朽的樹幹給阻擋住了，無法通過。,
160,5,1,#:Event_If_RebornMonster 6 5 0:#:Event_ScreenMessage 31121 0 0:Event_TriggerEvent 161 1 0:,負責警戒入侵者的凶暴蝕月兔發現了你，立刻發出叫聲打算召集同伴。,
161,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31122 0 0:Event_TriggerEvent 162 5 0:,凶暴蝕月兔：有入侵者！大家快把他抓起來！,
162,5,1,#:Event_If_Level 1 1 0:#:Event_BlackOut 31123 0 0 13 1 0 0:Event_TriggerEvent 163 3 0:,「不妙！牠們數量真多，我最好先找個地方躲起來。」,
163,5,1,#:Event_If_Level 1 1 0:#:Event_Transport 9001 21 0 53:Event_TriggerEvent 164 4 0:,回到起點,
170,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31126 0 0:Event_TriggerEvent 171 2 0:Event_RebornMonster 6 5 7:Event_RebornMonster 7 5 7:Event_RebornMonster 8 5 7:Event_RebornMonster 9 5 7:Event_RebornMonster 13 5 7:Event_RebornMonster 16 5 7:Event_EventState 153 6 0:Event_EventState 151 6 0:,露娜像是聽到了什麼，做出了要你安靜的手勢,
171,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31127 13 21:Event_TriggerEvent 172 2 0:,噓…我聽到凶暴蝕月兔的腳步聲往這裡走來了。,
172,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31128 0 0:Event_TriggerEvent 174 2 0:,你往後方看去，有隻臉上帶有刀疤的蝕月兔正大搖大擺的朝這裡走來。,
173,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31129 0 0:Event_TriggerEvent 174 2 0:,牠朝這裡打量了下，但似乎沒看到你們。,
174,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31130 13 21:Event_TriggerEvent 175 2 0:,那是負責警戒和巡邏的凶暴蝕月兔，你可千萬不要接近牠們，不然被發現肯定會被抓住的。,
175,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31131 13 21:Event_TriggerEvent 176 2 0:,我會施展為你施展一個引導魔法，只要你跟著地上的光點走就可以找到月光麻糬。,
176,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31132 13 21:Event_RebornMonster 11 5 7:Event_RebornMonster 1 6 8:,至於我，會先到洞窟的另一端等你，等你收集完麻糬我們就會合吧。,
177,5,1,#:Event_If_Monster 7 3 0:#:Event_RebornMonster 11 6 8:Event_RebornMonster 12 5 7:,開尋徑光點，產生器7到9,
153,5,1,#:Event_If_RebornMonster 1 5 0:Event_If_ScreenMessage 4 31155 17:#:Event_ScreenMessage 31155 0 0:,請先和露娜談話再繼續前進。,
178,5,1,#:Event_If_Monster 9 3 0:#:Event_RebornMonster 12 6 8:Event_RebornMonster 22 5 7:Event_RebornMonster 23 5 7:,開尋徑光點，產生器9到13,
179,5,1,#:Event_If_Monster 13 3 0:#:Event_EventState 200 5 0:Event_RebornMonster 22 6 8:Event_RebornMonster 23 6 8:Event_RebornMonster 25 5 7:,開尋徑光點，霸凌事件,
220,5,1,#:Event_If_Monster 31 3 0:#:Event_RebornMonster 26 5 7:Event_RebornMonster 27 5 7:Event_RebornMonster 28 5 7:Event_RebornMonster 18 5 7:Event_RebornMonster 20 5 7:Event_RebornMonster 14 5 7:Event_EventState 410 5 0:,開尋徑光點，霸凌事件到產生器14,
181,5,1,#:Event_If_Monster 14 3 0:#:Event_RebornMonster 29 5 7:Event_RebornMonster 30 5 7:Event_RebornMonster 15 5 7:Event_RebornMonster 26 6 8:Event_RebornMonster 27 6 8:Event_RebornMonster 28 6 8:,開尋徑光點，產生器14到產生器15,
200,6,1,#:Event_If_ScreenMessage 4 31133 17:#:Event_ScreenMessage 31133 0 0:Event_TriggerEvent 201 3 0:,你注意到前方傳來陣陣怒喝和哀嚎，快過去看看。,
201,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31134 0 0:Event_RebornMonster 31 5 7:Event_RebornMonster 32 5 7:Event_TriggerEvent 202 2 0:,你看到蝕月兔正在欺負月光兔們。,
204,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31135 0 0:Event_ShowMessage 31135 13 21:,快擊敗蝕月兔！,
300,5,1,#:Event_If_Monster 15 3 0:#:Event_RebornMonster 29 6 8:Event_RebornMonster 30 6 8:Event_RebornMonster 33 5 7:Event_RebornMonster 34 5 7:Event_RebornMonster 35 5 7:Event_RebornMonster 36 5 7:Event_RebornMonster 37 5 7:Event_RebornMonster 38 5 7:Event_RebornMonster 39 5 7:Event_RebornMonster 40 5 7:Event_RebornMonster 41 5 7:Event_RebornMonster 42 5 7:Event_RebornMonster 45 5 7:Event_RebornMonster 46 5 7:Event_RebornMonster 47 5 7:Event_RebornMonster 48 5 7:Event_RebornMonster 49 5 7:Event_RebornMonster 50 5 7:Event_RebornMonster 51 5 7:Event_RebornMonster 52 5 7:Event_RebornMonster 53 5 7:Event_RebornMonster 19 5 7:Event_RebornMonster 24 5 7:Event_RebornMonster 26 6 8:Event_RebornMonster 28 6 8:Event_RebornMonster 27 6 8:Event_ScreenMessage 31141 0 0:Event_TriggerEvent 301 2 0:Event_RebornMonster 21 6 8:,開跳跳兔舞會，關尋徑光點,
210,5,1,#:Event_If_Monster 31 3 0:#:Event_KillMonster 21643 0 0:Event_RebornMonster 32 6 8:Event_RebornMonster 55 5 7:Event_RebornMonster 56 5 7:Event_RebornMonster 57 5 7:Event_RebornMonster 58 5 7:Event_RebornMonster 59 5 7:Event_TriggerEvent 211 1 0:Event_RebornMonster 210 6 8:Event_RebornMonster 25 6 8:,月光兔們就定位,
202,5,1,#:Event_If_Level 1 1 0:#:Event_RebornMonster 31 6 8:Event_RebornMonster 54 5 7:Event_TriggerEvent 203 1 0:,讓蝕月兔走到定位，換產生器54,
203,5,1,#:Event_If_Level 1 1 0:#:Event_MonsterAction 54 1020 520 3 57 0:Event_TriggerEvent 204 1 0:,蝕月兔動態,
211,5,1,#:Event_If_Level 1 1 0:#:Event_MonsterAction 55 51 3656 3 57 0:Event_TriggerEvent 212 2 0:,真是太謝謝你了，多虧了你我們才能從蝕月兔的監禁中逃走。,
212,5,1,#:Event_If_Level 1 1 0:#:Event_MonsterAction 55 51 3657 3 57 0:Event_TriggerEvent 213 2 0:,不過你到底是…？,
213,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31138 0 0:Event_TriggerEvent 214 3 0:,你將沐恩長老貼出了佈告的事情一一跟他們說明。,
214,5,1,#:Event_If_Level 1 1 0:#:Event_MonsterAction 55 51 3658 3 57 0:Event_TriggerEvent 215 2 0:,原來如此啊，我們曾經聽到蝕月兔將部分搶來的月光麻糬保存在不遠處的岔路內，你可以去看看。,
215,5,1,#:Event_If_Level 1 1 0:#:Event_MonsterAction 55 51 3659 3 57 0:Event_TriggerEvent 216 1 0:,不過在這之前請讓我們為你施個魔法，做為謝禮。,
216,5,1,#:Event_If_Level 1 1 0:#:Event_RebornMonster 60 5 7:Event_RebornMonster 61 5 7:,開通往麻糬甕的尋徑光點,
301,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31142 0 0:Event_TriggerEvent 302 2 0:,牠們彷彿已經完全沉醉在慶典中，露出了迷濛的表情跳著舞。,
302,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31143 0 0:Event_TriggerEvent 303 2 0:,你發現其中幾隻有著金色的光芒！看起來麻糬就在他們身上。,
303,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31144 13 21:Event_ScreenMessage 31144 0 0:,小心的分辨牠們，使用月光槌給那些發出金色光芒的傢伙們致命一擊吧。,
310,5,1,#:Event_If_Monster 33 3 0:Event_If_Monster 34 3 0:Event_If_Monster 39 3 0:Event_If_Monster 47 3 0:#:Event_TriggerEvent 420 1 0:,開演戲用蝕月兔王,
311,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31147 0 0:Event_TriggerEvent 312 2 0:Event_RebornMonster 79 6 8:,正當露娜要開口說話時，一個巨大的聲音突然響起。,
308,5,1,#:Event_If_Monster 33 3 0:Event_If_Monster 34 3 0:Event_If_Monster 39 3 0:Event_If_Monster 47 3 0:#:Event_RebornMonster 62 5 7:Event_ScreenMessage 31145 0 0:Event_TriggerEvent 309 3 0:Event_RebornMonster 79 5 7:,開露娜,
309,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31146 0 0:Event_MonsterAction 62 51 3662 3 57 0:,快過去向她確認一下情況。,
312,5,1,#:Event_If_Level 1 1 0:#:Event_ScreenMessage 31148 0 0:Event_TriggerEvent 313 2 0:,蝕月兔王：「哼，哪來的臭味，打擾了我享用月光麻糬的興致。」,
313,5,1,#:Event_If_Level 1 1 0:#:Event_ShowMessage 31150 13 21:Event_TriggerEvent 314 2 0:,蝕月兔王：「兄弟們，還不快點把他們揪出來！」,
314,5,1,#:Event_If_Level 1 1 0:#:Event_RebornMonster 35 6 8:Event_RebornMonster 36 6 8:Event_RebornMonster 37 6 8:Event_RebornMonster 38 6 8:Event_RebornMonster 40 6 8:Event_RebornMonster 41 6 8:Event_RebornMonster 42 6 8:Event_RebornMonster 45 6 8:Event_RebornMonster 46 6 8:Event_RebornMonster 48 6 8:Event_RebornMonster 49 6 8:Event_RebornMonster 50 6 8:Event_RebornMonster 64 5 7:Event_RebornMonster 65 5 7:Event_RebornMonster 66 5 7:Event_RebornMonster 67 5 7:Event_RebornMonster 68 5 7:Event_RebornMonster 69 5 7:Event_RebornMonster 70 5 7:Event_RebornMonster 71 5 7:Event_RebornMonster 72 5 7:Event_RebornMonster 73 5 7:Event_RebornMonster 74 5 7:Event_RebornMonster 75 5 7:,你看到大批的蝕月兔朝你衝過來！把他們統統打倒吧！,
320,5,1,#:Event_If_Monster 64 3 0:Event_If_Monster 65 3 0:Event_If_Monster 66 3 0:Event_If_Monster 67 3 0:Event_If_Monster 68 3 0:Event_If_Monster 69 3 0:Event_If_Monster 70 3 0:Event_If_Monster 71 3 0:Event_If_Monster 72 3 0:Event_If_Monster 73 3 0:Event_If_Monster 74 3 0:Event_If_Monster 75 3 0:#:Event_ScreenMessage 31151 0 0:Event_TriggerEvent 321 1 0:,蝕月兔王切成怪物判斷,
